import React, { useState, useEffect } from 'react';
import axios from "axios"
import './App.css';


function App() {
  const [coins, setCoins] = useState([]);
  useEffect(() => {
    axios.get('https://api.coingecko.com/api/v3/coins/list?include_platform=false')
    .then(res => {
      setCoins(res.data);

    }).catch(error => console.log(error))
  },[]);

  return (
    <div className="App">
      <h1>API</h1>
    </div>
  );
}

export default App;
